def find_judge(n, trust)
  return 1 if n == 1
  town = (1..n).to_a
  trusting = []
  much_trust = Hash.new(0)
  trust.each do |a, b|
    trusting << a
    much_trust[b] += 1
  end
  return -1 if much_trust.key(n-1) == nil
  wip = much_trust.key(n - 1)
  if trusting.include?(wip)
    return -1
  else
    return wip
  end
end

